import React from "react";
import "./ChefCard.css";
import data from "../../../epicure.json"


const ChefCard: React.FC = () => {
      return (<>
      
        {data.chefs.map((chef) => (
            <section id="chef-img">
            <img src={chef.img} key={chef.img} alt={chef.name}  />
            <h1>{chef.name}</h1>
            </section>
            ))}

        </>
      )
    }

export default ChefCard;
